class Submission:
    def __init__(self, submission_id, user_id):
        self.submission_id = submission_id
        self.user_id = user_id
        self.status = 'created'
        self.published = False
        self.activities = []

    def update_status(self, new_status):
        self.status = new_status
        self.log_activity(f'Status updated to {new_status}')

    def publish(self):
        if not self.published:
            self.published = True
            self.status = 'published'
            self.log_activity('Submission published')
        else:
            print('Submission already published. Cannot publish again.')

    def log_activity(self, activity):
        self.activities.append(activity)

    def deactivate_publish(self):
        self.published = True  # Indicating it's published and cannot be published again

    def generate_fabs_file(self):
        return f"FABS file for submission {self.submission_id} generated."

    def remove_zip_code_suffix(self, zip_code):
        return zip_code[:-4] if len(zip_code) > 4 else zip_code

class User:
    def __init__(self, user_id, name):
        self.user_id = user_id
        self.name = name

class Agency:
    def __init__(self, agency_id, name):
        self.agency_id = agency_id
        self.name = name

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def create_submission(self, submission_id, user_id):
        submission = Submission(submission_id, user_id)
        self.submissions[submission_id] = submission
        return submission

    def get_submission(self, submission_id):
        return self.submissions.get(submission_id, None)

class UserManager:
    def __init__(self):
        self.users = {}

    def create_user(self, user_id, name):
        user = User(user_id, name)
        self.users[user_id] = user
        return user

    def get_user(self, user_id):
        return self.users.get(user_id, None)

